import React, {Component} from "react";
import "../Css/MapMarker.css"
//import axios from "../utils/Axios";
import axios from "axios";

class MapMarker extends Component {
    constructor(props) {
        super(props);

        this.state = {
            weather: []
        }; 
        this.componentDidMount = this.componentDidMount.bind(this);
    }

    componentDidMount() {  
        let MarkerURL  = `${process.env.REACT_APP_API}/marker/all-markers`;       
        let WeatherURL = "http://api.weatherbit.io/v2.0/current?&key=ec2ab6a62d214719a8fcbf322cb7ce96&lat=38.123&lon=-78.543"
        // let WeatherURL = process.env.REACT_APP_WEATHER_BIT + "lat=" + this.props.lat + "&long=" + this.props.lng + "&"+ process.env.REACT_APP_WEATHER_BIT_KEY;  

        axios.get(WeatherURL)
        .then( (response)=>{
            this.setState({weather: response.data});        
        })
        .catch((error)=> {
            return error
        });
    }
    render() {

        let weatherForecast = this.state.weather.map(forecast => (

                <div>
                <h1>forecast.timezone</h1>
            </div>



        ))
    return(
            <div className="MapMarker">
                <h1>{this.props.name}</h1>
                {weatherForecast}
            </div>
        )
    }
}

export default MapMarker;
